description:
Chris Powell was a normal New York City teenager until he found the Darkhawk amulet in an old abandoned amusement park. With the amulet he could transfer his consciousness into a shadowy avian android named Darkhawk.  Chris vowed to use the amulet as &quot;an edge against crime.&quot;  

Darkhawk was created by writer and then Marvel editor-in-chief Tom DeFalco, and artist Mike Manley.  Although created by DeFalco, the majority of the series was actually written by Danny Fingeroth.


